description:
Instauré en juin 2009, étendu sous certaines conditions aux jeunes de moins de 25 ans en septembre 2010 et applicable désormais dans tous les DOM, le revenu de solidarité active (RSA) est versé par les CAF à 2 086 000 foyers allocataires fin juin 2012 en France entière.
En France métropolitaine, le nombre de foyers allocataires du RSA progresse modérément, de 2,6 % entre la mi-2011 et la mi-2012. Après une forte hausse liée à la récession de 2008-2009, la progression du nombre d’allocataires du RSA socle se poursuit mais à un rythme sensiblement inférieur, tandis que celle du nombre d’allocataires du RSA activité seul marque le pas après une montée en charge très nette la première année du dispositif. Néanmoins, la croissance du nombre d’allocataires du RSA se renforce à la mi-2012 sous les effets différés du retournement conjoncturel observé à partir de la mi-2011.
Le turnover des allocataires du RSA diminue légèrement à la mi-2012, notamment pour ceux du RSA activité seul. Plus proches du marché du travail, ces allocataires entrent et sortent du dispositif plus fréquemment.
Depuis 2010, le fléchissement de la croissance du nombre d’allocataires du RSA socle a été plus marqué pour les 25-34 ans, plus sensibles que les autres classes d’âge à la conjoncture économique. La progression un peu plus soutenue du nombre d’allocataires au cours du 1er semestre 2012 concerne quasiment toutes les classes d’âge.
Les données concernent :
- l'évolution en glissement annuel du nombre d'allocataires du RMI, de l’API ou du RSA socle, du nombre de chômeurs au sens du BIT et du PIB depuis 2006;
- le nombre de foyers ayant un droit payable au RSA;
- le nombre de foyers allocataires du RSA activité seul depuis juin 2009;
- le taux de rotation trimestriel des allocataires du RSA entre septembre 2009 et juin 2012  selon la composante;
- le nombre de foyers allocataires du RMI, de l'API ou du RSA socle en fonction de l'âge;
- le nombre de foyers allocataires du RSA jeune depuis décembre 2010;
- le taux de rotation trimestriel des allocataires du RSA en juin 2012 selon la composante et l'âge.

L’accessibilité géographique aux soins des personnes âgées de 70 ans ou plus n’apparaît pas plus faible que celle des adultes plus jeunes. Lorsqu’elles consultent le médecin généraliste, les personnes âgées de 70 ans ou plus ont en effet des temps de trajet plus faibles que les adultes plus jeunes, car elles recourent plus souvent au professionnel le plus proche de chez elles. En outre, leurs recours aux masseurs-kinésithérapeutes se font plus souvent par des visites à domicile.
Lorsqu’elles se rendent à l’hôpital, les personnes âgées de 70 ans ou plus ont, là aussi, des temps d’accès effectifs légèrement plus faibles que les autres adultes, en lien avec une plus forte propension à se rendre à l’établissement le plus proche de chez elles.
Les données concernent:
- le temps moyen de recours effectif au professionnel de santé des patients selon leur âge;
- le taux de recours par âge pour 1 000 habitants pour cinq spécialités;
- les temps médians d’accès théoriques et effectifs des 19-69 ans et des 70 ans ou plus;
- les temps médians d’accès effectifs et théoriques selon le type de commune et l’âge.

Près de 790 000 accouchements, répartis dans 535 maternités, ont eu lieu en 2010 en France métropolitaine. Un chiffre en augmentation de 5 % par rapport à 2001. Dans le même temps, un cinquième des maternités ont fermé. Ces fermetures découlent d’un mouvement amorcé dans les années 1970, dont le but est de rendre l’accouchement plus sûr en fermant les maternités à faible activité. Les maternités sont désormais moins nombreuses, mais mieux équipées.
Malgré la réduction du nombre de maternités, le temps d’accès médian observé pour s’y rendre est resté stable entre 2001 et 2010 : la moitié des femmes mettent moins de 17 minutes pour aller accoucher. Les différences entre les communes se sont réduites, celles qui avaient un temps d’accès élevé en 2001 ayant vu ce temps diminuer. Cette stabilité globale des temps d’accès tient principalement à un recours plus fréquent qu’avant à la maternité la plus proche du domicile.
Les données concernent notamment :
- l'évolution de l'offre et des temps d'accès aux maternités, entre 2001 et 2010;
- les communes équipées d'au moins une maternité en 2001 ou en 2010;
- l'évolution du temps d'accès médian observé à la maternité entre 2001 et 2010, par département;      
- l'évolution du temps médian selon la situation de la commune en 2001;
- la décomposition de l'évolution des temps d'accès médians aux maternités entre 2001 et 2010.

Les valeurs nationales sont présentées dans le fichier Excel « HAD_2011_Valeurs_Nationales » : 
- par groupe homogène de prise en charge (GHPC);
- par association Mode de Prise en Charge Principal x Mode de Prise en Charge Associé;
- par Mode de Prise en Charge Principal.
Les données du PMSI 2011 sont également disponibles par GHPC (nombre de journées), elles permettent d’apprécier le taux de sondage par GHPC.
Par ailleurs, en vue de vous éclairer et de vous guider dans la lecture des informations, le document « Guide de lecture Valeurs nationales HAD 2011» complète le fichier Excel. Il présente :
- la composition de l’échantillon 2011 ;
- les modalités de calcul des valeurs nationales de coûts constituées à partir des données ENCC relatives à l’activité 2011 des établissements : prise en compte du coefficient géographique, suppression de certaines séquences, opérations de calage… ;
- des indications sur le contenu des différents onglets du fichier Excel.

Recensement des procédures administratives relatives aux risques issu de l'application GASPAR, mis à jour directement par les services instructeurs départementaux ou régionaux, réunissant des informations sur les documents d'information préventive ou à portée réglementaire, dont :
    les plans de prévention des risques naturels et assimilés, miniers et technologiques ;
    les reconnaissances de l'état de catastrophe naturelle ;
    les dossiers départementaux d'information sur les risques majeurs (DDRM) ;
    les documents d'information communale sur les risques majeurs (DICRIM).

Interventions des sapeurs-pompiers
Ces données sont collectées tous les ans par la Direction générale de la sécurité civile et de la gestion des crises auprès des services d’incendie et de secours.
Les services d’incendie et de secours regroupent à la fois les SDIS (services départementaux d’incendie et de secours), la BSPP (brigade de sapeurs-pompiers de Paris) et le BMPM (bataillon de marins-pompiers de Marseille). Ils défendent respectivement les populations du département, de la petite couronne (départements 75, 92, 93 et 94) et de la ville de Marseille
Les interventions sont classées en 5 familles :
    * les incendies ;
    * le secours à personne lui-même composé du secours à victime et de l’aide à personne ;
    * les accidents de circulation (tous modes de transport) ;
    * les risques technologiques ;
    * les opérations diverses réparties en protection des biens et divers.
Ces données sont également disponibles sous forme graphique sur le site du ministère de l’intérieur (www.interieur.gouv.fr) dans la rubrique Publications – Statistiques – Sécurité civile.

### Programme des éditions des Journées européennes du patrimoine (JEP)
Ce jeu de données rassemble l’ensemble des événements programmés chaque année dans le cadre des Journées européennes du patrimoine, coordonnées par le ministère de la Culture.&#x20;
Il recense plusieurs milliers de manifestations sur l’ensemble du territoire (métropole et outre-mer) proposées par des acteurs publics et privés : visites de monuments, expositions, spectacles, ateliers, conférences.Chaque enregistrement décrit un événement avec ses informations essentielles : identifiant, intitulé (en plusieurs langues), description, dates, horaires, lieu, conditions d’accès, type de public visé et état de programmation.
Ce jeu de données constitue une ressource de référence pour suivre et valoriser la programmation des JEP, faciliter la découvrabilité des événements et encourager leur réutilisation (applications mobiles, sites d’information culturelle, recherche). &#x20;
Site officiel : <https://journeesdupatrimoine.culture.gouv.fr>
